import React, { useState } from "react";
import PropTypes from "prop-types";
import Styles from "./styles";

const GameButton = ({ label, onClick, position, player }) => {

    const chooseBorder = () => {
        let style;
        switch (position) {
            case "120":
                style = "";
                break;
            default:
                style = "";
                break;
        }
        return style
    }

    return (<div style={Styles.container}><div style={chooseBorder()}>{label}</div></div>)
}


GameButton.propTypes = {
    label: PropTypes.string
}

export default GameButton;
